		<script>
			$(function() {
				const domain = 'https://urantiapedia.org';
				const path = '/en/The_Urantia_Book/';
				const classnames = 'list-group-item btn-sm list-group-item-action py-0 px-2';

				const getLinks = (reference) => {

						(ref.length === 2 ? `${path}${ref[0]}#p${ref[1]}` :
						`${path}${ref[0]}#p${ref[1]}_${ref[2]}`));
					const link1 = `Link to check: <a href="${domain}${url}">UB ${reference}</a>`;
					const link2 = `Link to copy: <a href="${url}">UB ${reference}</a>`;
					return `<div class="${classnames}">${link1}&nbsp;&nbsp;&nbsp;${link2}</div>`;
				};

				$('#btnFind').on('click', function() {
					const page = $('#txtPage').val();
					const par = $('#txtPar').val();
					if (page === '' || isNaN(parseInt(page)) || (par != '' && isNaN(parseInt(par)))) return;
					const html = rels[parseInt(page) - 1]
						.filter((rel, i) => {
							return (par === '' || (par != '' && i === parseInt(par) - 1));
						})
						.map(getLinks)
						.join('\n');
					$('#lbxFound').html(html);
				});

				$('#btnFind2').on('click', function() {
					const reference = $('#txtRef').val();
					if (reference === '') return;
					const ref = reference.split(/[:.]/);
					if (ref.length === 0) return;
					let found = false;
					if (ref.length === 3 && !rels.find(rel => rel.includes(reference))) {
						alert('Reference seems to not exist in Urantia Book!');
						return;
					}
					const html = getLinks(reference);
					$('#lbxFound').html(html);
				});
			});
		</script>
